import { BrowserRouter as Router, Route } from "react-router-dom";
import UserProvider from "./context";
import AppView from "./views/AppView";
import LoginView from "./views/LoginView";

function App() {
  return (
    <Router>
      <UserProvider>
        <Route path="/" exact>
          <AppView />
        </Route>
        <Route path="/login">
          <LoginView />
        </Route>
      </UserProvider>
    </Router>
  );
}

export default App;
